def find_connected_rooms(rooms: dict, start_room: int) -> list:
    stack = [start_room]
    seen = {room: True for room in rooms}
    connected_rooms = []
    while stack:
        room_idx = stack.pop()
        if not seen[room_idx]:
            seen[room_idx] = True
            connected_rooms.append(room_idx)
            for key in rooms[room_idx]:
                if not seen[key]:
                    stack.append(key)
    return connected_rooms

def find_connected_rooms(rooms: dict, start_room: int) -> list:
    stack = [start_room]
    seen = {room: False for room in rooms}
    connected_rooms = []
    while stack:
        room_idx = stack.pop()
        if not seen[room_idx]:
            seen[room_idx] = False
            connected_rooms.append(room_idx)
            for key in rooms[room_idx]:
                if not seen[key]:
                    stack.append(key)
    return connected_rooms
